-- Your SQL goes here
CREATE TABLE attributor (
	id INT AUTO_INCREMENT NOT NULL,
	name VARCHAR(255) NOT NULL,
	bio LONGTEXT NOT NULL,
	PRIMARY KEY (id)
);

CREATE TABLE bird (
	id INT AUTO_INCREMENT NOT NULL,
	common_name VARCHAR(255) NOT NULL,
	commonwealth_status VARCHAR(255) NOT NULL,
	nsw_status VARCHAR(255) NOT NULL,
	profile VARCHAR(255) NOT NULL,
	scientific_name VARCHAR(255) NOT NULL,
	stats VARCHAR(255) NOT NULL,
	stats_for VARCHAR(255) NOT NULL,
	PRIMARY KEY (id)
);

CREATE TABLE threat (
	id INT AUTO_INCREMENT NOT NULL,
	name VARCHAR(255) NOT NULL,
	PRIMARY KEY (id)
);

CREATE TABLE attribute (
	id INT AUTO_INCREMENT NOT NULL,
	bird_id INT NOT NULL,
	attributor_id INT NOT NULL,
	bio LONGTEXT NOT NULL,
	link VARCHAR(255) NOT NULL,
	FOREIGN KEY (bird_id) REFERENCES bird (id),
	FOREIGN KEY (attributor_id) REFERENCES attributor (id),
	PRIMARY KEY (id)
);

CREATE TABLE bird_threat (
	bird_id INT NOT NULL,
	threat_id INT NOT NULL,
	FOREIGN KEY (bird_id) REFERENCES bird (id),
	FOREIGN KEY (threat_id) REFERENCES threat (id),
	PRIMARY KEY (bird_id,threat_id)
);

